def palQgen10(l): # generator of palindromes in base 10 of length <= 2*l
    if l > 0:
        yield 0
        for x in range(1,l+1):
            for y in range(10**(x-1),10**x):
                s = str(y)
                yield int(s+s[-2::-1])
